function addcmd(devtype) {
	$("#cmd").find('option').remove();

	for (let key in commands) {
		if(commands[key].DeviceType == devtype && commands[key].Letter!="F") {
			$("#cmd").append($("<option></option>")
				.attr("value",commands[key].id)
